//RULES FORMAT END
function EventParameter(event) {
    var i = 0;
    this.param = [];
    this.enable = false;

    if (event) {
        this.enable = true;
        for (i = 0; i < event.length; i += 1) {
            this.param.push(parseInt(event[i], 10));
        }
    }
}

function EventTypeFilter() {
    this.enable = false;
    this.error = null;
    this.profil = null;
    this.usage = null;
}

EventTypeFilter.prototype.setFilter = function(type, eventParameter) {
    this[type] = eventParameter;
};

EventTypeFilter.prototype.isEnabled = function() {
    return this.enable;
};

function Prisme(database, parameters) {
    AbstractFormatter.call(this, database);

    var eventsObjectFilterParam = (parameters.eventsObjectFilter && (parameters.eventsObjectFilter.length > 0)) ? parameters.eventsObjectFilter : this.DEFAULT_EVENTS_OBJECT_FILTER,
        eventTypeSessionFilterParam = (parameters.eventTypeSessionFilter && (parameters.eventTypeSessionFilter.length > 0)) ? parameters.eventTypeSessionFilter : this.DEFAULT_EVENT_TYPE_SESSION_FILTER,
        eventTypeRealTimeFilterParam = (parameters.eventTypeRealTimeFilter && (parameters.eventTypeRealTimeFilter.length > 0)) ? parameters.eventTypeRealTimeFilter : this.DEFAULT_EVENT_TYPE_REALTIME_FILTER,
        eventsObject = eventsObjectFilterParam.split(';');

    this.eventTypeSessionFilter = this.parseEventsFilter(eventTypeSessionFilterParam);
    this.eventTypeRealTimeFilter = this.parseEventsFilter(eventTypeRealTimeFilterParam);

    this.eventTypeSessionFilter.enable = eventsObject.indexOf('session') > -1 ? true : false;
    this.eventTypeRealTimeFilter.enable = eventsObject.indexOf('realtime') > -1 ? true : false;
}

Prisme.prototype = Object.create(AbstractFormatter.prototype);
Prisme.prototype.constructor = Prisme;

Prisme.prototype.parseEventsFilter = function(eventsFilter) {
    var eventTypeFilter = new EventTypeFilter(),
        //parse units events => error, usage and profil
        events = eventsFilter.split(';'),
        parsedElements = [],
        i = 0,
        j = 0,
        tabTemp;

    //parse for each unit events, numbers of elements to return (n first, and m last)
    for (i = 0; i < events.length; i += 1) {
        tabTemp = events[i].split(',');
        parsedElements[tabTemp[0]] = [];
        for (j = 1; j < tabTemp.length; j += 1) {
            parsedElements[tabTemp[0]].push(tabTemp[j]);
        }
    }

    //set, for each type filter, the different parameters : enable, n first and m last elements.
    eventTypeFilter.setFilter('error', new EventParameter(parsedElements.error));
    eventTypeFilter.setFilter('profil', new EventParameter(parsedElements.profil));
    eventTypeFilter.setFilter('usage', new EventParameter(parsedElements.usage));

    return eventTypeFilter;
};

Prisme.prototype.init = function() {
    AbstractFormatter.prototype.init.call(this);
    this.duration = 0;
    this.isInitSessionSend = false;
    this.currentBitrate = 0;
};

Prisme.prototype.generateSessionId = function() {
    return AbstractFormatter.prototype.generateSessionId.call(this, '-');
};

Prisme.prototype.process = function(metric) {
    var formattedData = null;

    if (!this.database) {
        return formattedData;
    }

    if (!metric) {
        formattedData = this.formatterRecurring();
    } else {
        if (metric.hasOwnProperty('metadata') && metric.metadata.duration !== undefined) {
            this.duration = metric.metadata.duration;
        }//if session.startBufferingTime and session.startPlayingTime are undefined, do not send session metric.
        if (metric.hasOwnProperty('session') && metric.session.startBufferingTime && metric.session.startPlayingTime) {
            formattedData = this.formatterSession();
        } // error is defined in eventTypeRealTimeFilter ? error type code also defined?
        else if (metric.hasOwnProperty('error')) {
            formattedData = this.formatterRealTime('/has/realtime/error/');
        } //use is defined in eventTypeRealTimeFilter ?
        else if ((metric.hasOwnProperty('action') && (this.eventTypeRealTimeFilter.usage.enable === true))) {
            formattedData = this.formatterRealTime('/has/realtime/use/');
        } // profil is defined in eventTypeRealTimeFilter ?
        else if ((metric.hasOwnProperty('encoding') && metric.encoding.hasOwnProperty('contentType') && metric.encoding.contentType === 'video' && (this.eventTypeRealTimeFilter.profil.enable === true))) {
            formattedData = this.formatterRealTime('/has/realtime/profil/');
        } else if (metric.hasOwnProperty('state')/* && this.firstAccess === false*/) {
            if (metric.state.current === 'stopped' && metric.state.previousState !== 'init') {
                formattedData = this.formatterSession();
            } //For Prisme, stalled state is an error
            else if (metric.state.current === 'buffering') {
                formattedData = this.formatterRealTime('/has/realtime/error/', 'buffering');
            } else if (metric.state.current === 'playing' && !this.isInitSessionSend) {
                formattedData = this.formatterSession();
                this.isInitSessionSend = true;
            }
        }
    }

    return formattedData;
};

//type 0
Prisme.prototype.formatterRecurring = function() {
    if (this.duration > 0) {
        return null;
    } else { //send Session event, it's a LIVE content
        return this.formatterSession(['status']);
    }
};

//type 1, 2 and 3
Prisme.prototype.formatterRealTime = function(realTimeName, param) {
    var data = [],
        realTimeObj = {},
        realTimeTempObj = {},
        state,
        errorVo;

    data.push(new Date().getTime());
    data.push(realTimeName);

    //Real time events are disable, send nothing.
    if (!this.eventTypeRealTimeFilter.isEnabled()){
        return null;
    }

    realTimeObj = this.formatSessionObject(['browserid', 'uuid', 'status', 'watchStartDate', 'watchEndDate', 'minBitrate', 'maxBitrate', 'startLaunchDate', 'startBufferingDate', 'pfsSessionId', 'userData']);

    switch (realTimeName) {
        case '/has/realtime/use/':
            //Add action info in realTimeUseObj
            realTimeTempObj.usage = this.formatLastActionObject([]);
            break;
        case '/has/realtime/profil/':
            //Add encoding info in realTimeProfilObj
            realTimeTempObj.profil = this.formatLastEncodingObject([]);
            this.currentBitrate = realTimeTempObj.profil.changeBitrate;
            break;
        case '/has/realtime/error/':
            //Add error info in realTimeErrorObj
            if (param && param === 'buffering') {
                //send an error object with orangeCode = 30
                state = this.database.getLastMetricValue('state');
                if (state === null) {
                    return null;
                }
                errorVo = new MetricsVo.Error();

                errorVo.code = 0;
                errorVo.message = 'buffering state';
                errorVo.position = this.formatPositionValue(state.position);

                realTimeTempObj.error = this.formatErrorObject([], errorVo);
            } else {
                realTimeTempObj.error = this.formatLastErrorObject([]);
            }

            realTimeTempObj.error.condition = this.formatTheConditionObject([]);
            //if OrangeErrorCode should not be returned by real time
            if ((this.eventTypeRealTimeFilter.error.enable === false) ||
                (this.eventTypeRealTimeFilter.error.enable === true && (this.eventTypeRealTimeFilter.error.param.indexOf(realTimeTempObj.error.orangeErrorCode) === -1))) {
                return null;
            }
            break;
    }
    realTimeObj.event = realTimeTempObj;

    realTimeObj.state = this.formatStateObject();

    realTimeObj.encoding = this.formatSessionObject(['clientSessionId','playerId','url','userAgent','contentDuration','browserid', 'uuid', 'status','watchStartDate','watchEndDate','startLaunchDate','startBufferingDate','pfsSessionId', 'userData']);
    if (realTimeObj.encoding.minBitrate) {
        realTimeObj.encoding.min = realTimeObj.encoding.minBitrate;
    }
    if (realTimeObj.encoding.maxBitrate) {
        realTimeObj.encoding.max = realTimeObj.encoding.maxBitrate;
    }
    realTimeObj.encoding.minBitrate = undefined;
    realTimeObj.encoding.maxBitrate = undefined;
    realTimeObj.encoding.current = this.currentBitrate;

    realTimeObj.playing = this.formatStateCount('playing');
    realTimeObj.buffering = this.formatStateCount('buffering');
    realTimeObj.seeking = this.formatStateCount('seeking');
    realTimeObj.paused = this.formatStateCount('paused');

    data.push(realTimeObj);

    return data;
};

//type 4
Prisme.prototype.formatterSession = function() {
    var data = [],
        date = new Date().getTime(),
        sessionObj = {};

    data.push(date);
    data.push('/has/session/');

    //Session events are disable, send nothing.
    if (!this.eventTypeSessionFilter.isEnabled()) {
        return null;
    }

    sessionObj = this.formatSessionObject(['playerId']);
    sessionObj.metaData = this.formatMetadataObject([]);
    sessionObj.events = {};
    sessionObj.events.usage = [];
    sessionObj.events.error = [];
    sessionObj.events.profil = [];

    sessionObj.events.profil = this.formatMetricsList('encoding', this.eventTypeSessionFilter.profil.param[0], this.eventTypeSessionFilter.profil.param[1], 'video');
    sessionObj.events.usage = this.formatMetricsList('action', this.eventTypeSessionFilter.usage.param[0], this.eventTypeSessionFilter.usage.param[1]);
    sessionObj.events.error = this.formatMetricsList('error', this.eventTypeSessionFilter.error.param[0], this.eventTypeSessionFilter.error.param[1]);

    sessionObj.counts = {};
    sessionObj.counts.error = [];
    sessionObj.counts.profil = [];

    //add Counts content.
    sessionObj.counts.playing = this.formatStateCount('playing');
    sessionObj.counts.buffering = this.formatStateCount('buffering');
    sessionObj.counts.seeking = this.formatStateCount('seeking');
    sessionObj.counts.paused = this.formatStateCount('paused');
    sessionObj.counts.profil = this.getCountsMetricTypeObject('encoding', 'bitrate', date, ['date', 'originBitrate', 'position'], 'video');
    sessionObj.counts.error = this.getCountsMetricTypeObject('error', 'orangeErrorCode', date, ['url', 'comment']);

    data.push(sessionObj);

    return data;
};

Prisme.prototype.formatMetricsList = function(metricType, nbFirstElts, nbLastElts, mediaType) {
    var list = [],
        metrics = this.database.getMetrics(metricType, mediaType, nbFirstElts, nbLastElts),
        formattedObject,
        i;

    for (i = 0; i < metrics.length; i += 1) {
        switch (metricType) {
            case 'encoding':
                formattedObject = this.formatEncodingObject([], metrics[i][metricType]);
                break;
            case 'action':
                formattedObject = this.formatActionObject([], metrics[i][metricType]);
                break;
            case 'error':
                formattedObject = this.formatErrorObject([], metrics[i][metricType]);
                break;
            default:
                return [];
        }
        if (formattedObject) {
            this.setFieldValue('date', metrics[i].date);
            list.push(formattedObject);
        }
    }

    return list;
};

Prisme.prototype.getCountsMetricTypeObject = function(metricType, paramRef, date, excludedList, mediaType) {
    var elts = this.database.getMetrics(metricType, mediaType, undefined, undefined);
    return this.formatMetricCounts(excludedList, elts, metricType, paramRef, date);
};

//RULES FORMAT
Prisme.prototype.formatSessionObject = function(excludedList) {
    var session = this.database.getLastMetricValue('session'),
        metadata = this.database.getLastMetricValue('metadata', 'video'),
        state,
        REGX_URI_PARAMETERS = /(\?|\&)([^=]+)\=([^&]+)/g,
        manifestParametersAndValue;

    if (session === null) {
        return {};
    }

    this.data = {};
    this.excludedList = excludedList;

    this.setFieldValue('clientSessionId', session.id);
    this.setFieldValue('playerId', session.playerid);
    this.setFieldValue('uuid', undefined);
    this.setFieldValue('url', session.uri);
    this.setFieldValue('userAgent', session.userAgent);
    this.setFieldValue('contentId', undefined);
    if (session.minBitrate) {
        this.setFieldValue('minBitrate', session.minBitrate / 1000);
    }
    if (session.maxBitrate) {
        this.setFieldValue('maxBitrate', session.maxBitrate / 1000);
    }
    this.setFieldValue('startLaunchDate', session.startTime);
    this.setFieldValue('startBufferingDate', session.startBufferingTime);
    this.setFieldValue('watchStartDate', session.startPlayingTime);
    while ((manifestParametersAndValue = REGX_URI_PARAMETERS.exec(session.uri)) !== null) {
        if (manifestParametersAndValue[2] === 'SID') {
            this.setFieldValue('pfsSessionId', manifestParametersAndValue[3]);
            break;
        }
    }
    //TBD uuid, contentName, httpBitrate

    this.setFieldValue('status', 'IN_PROGRESS');
    if (this.firstAccess === true) {
        this.firstAccess = false;
    } else {
        state = this.database.getLastMetricValue('state');
        if (state !== null) {
            if (state.current === 'stopped') {
                if (state.reason === 2) {
                    this.setFieldValue('status', 'KO');
                } else {
                    this.setFieldValue('status', 'OK');
                }
                // Set max position only for on-demand contents
                if (metadata && metadata.duration >= 0) {
                    this.setFieldValue('maxPosition', (session.maxPosition !== undefined) ? this.formatPositionValue(session.maxPosition) : 0);
                }
            }
        }
    }
    this.setFieldValue('watchEndDate', new Date().getTime());
    if (metadata === null) {
        return this.data;
    }

    if (metadata.duration >= 0 && metadata.duration !== Infinity) {
        this.setFieldValue('contentDuration', metadata.duration);
    }

    this.setFieldValue('userData', session.userData);

    return this.data;
};

Prisme.prototype.formatStateObject = function() {

    function capitaliseFirstLetter(string) {
        return string.charAt(0).toUpperCase() + string.slice(1);
    }

    var state = this.database.getLastMetricValue('state');
    if (state === null) {
        return {};
    }

    this.data = {};

    this.setFieldValue('current', capitaliseFirstLetter(state.current));
    this.setFieldValue('detail', state.reason);
    this.setFieldValue('previous', capitaliseFirstLetter(state.previousState));
    this.setFieldValue('previoustime', state.previousTime);
    this.setFieldValue('position', this.formatPositionValue(state.position));

    // this.data.current = capitaliseFirstLetter(state.current);
    // this.data.detail = state.reason;
    // this.data.previous = capitaliseFirstLetter(state.previousState);
    // this.data.previoustime = state.previousTime;
    // this.data.position = this.formatPositionValue(state.position);

    return this.data;
};

Prisme.prototype.formatEncodingObject = function(excludedList, encoding) {
    this.excludedList = excludedList;

    this.data = {};

    this.setFieldValue('date', encoding.date);
    this.setFieldValue('originBitrate', encoding.previousBitrate / 1000);
    this.setFieldValue('changeBitrate', encoding.bitrate / 1000);
    this.setFieldValue('position', this.formatPositionValue(encoding.position));

    return this.data;
};

Prisme.prototype.formatMetricCounts = function(excludedList, metricsList, metricType, paramRef, date) {

    var counts = {},
        array = [],
        metric,
        value,
        i;

    for (i = 0; i < metricsList.length; i++) {
        metric = metricsList[i][metricType];
        value = metric[paramRef];

        if (metricType === 'encoding' && metric.time === undefined) {
            metric.time = date - metric.date;
        }

        if (!counts[value]) {
            counts[value] = metric;
            counts[value].nb = 1;
        } else {
            counts[value].nb++;
            if (metric.time !== undefined) {
                counts[value].time += metric.time;
            }
        }
    }

    for (value in counts) {
        if (metricType === 'encoding') {
            this.formatEncodingObject(excludedList, counts[value]);
            this.setFieldValue('time', counts[value].time);
        } else if (metricType === 'error') {
            this.formatErrorObject(excludedList, counts[value]);
        } else {
            return {};
        }
        this.setFieldValue('nb', counts[value].nb);
        array.push(this.data);
    }

    return array;
};

Prisme.prototype.formatLastEncodingObject = function(excludedList) {
    var encoding = this.database.getLastMetricValue('encoding', 'video');

    if (encoding === null) {
        return {};
    }

    return this.formatEncodingObject(excludedList, encoding);
};

Prisme.prototype.formatActionObject = function(excludedList, action) {
    var prismeTypeCode = -1,
        addInfos,
        position = action.position;

    this.data = {};

    this.excludedList = excludedList;

    switch (action.type) {
        case 'stopped' :
            prismeTypeCode = this.USE_STOP;
            break;
        case 'seek':
            prismeTypeCode = this.USE_SEEK;
            addInfos = 'origin:'+this.formatPositionValue(action.origin)+';end:'+this.formatPositionValue(action.position);
            break;
        case 'play':
            prismeTypeCode = this.USE_PLAY;
            break;
        case 'pause':
            prismeTypeCode = this.USE_PAUSE;
            break;
        case 'trickMode':
            prismeTypeCode = action.speed > 1 ? this.USE_FAST_FORWARD : this.USE_FAST_BACKWARD;
            addInfos = 'speed:'+Math.abs(action.speed)+';origin:'+this.formatPositionValue(action.origin)+';end:'+this.formatPositionValue(action.position);
            position = action.origin;
            break;
    }

    if (prismeTypeCode === -1) {
        return;
    }

    this.setFieldValue('date', action.date);
    this.setFieldValue('typeCode', prismeTypeCode);
    if (addInfos) {
        this.setFieldValue('addInfos', addInfos);
    }
    this.setFieldValue('position', this.formatPositionValue(position));

    return this.data;
};

Prisme.prototype.formatLastActionObject = function(excludedList) {
    var action = this.database.getLastMetricValue('action');

    if (action === null) {
        return {};
    }

    return this.formatActionObject(excludedList, action);
};

Prisme.prototype.formatTheConditionObject = function(excludedList) {
    var condition = this.database.getLastMetricValue('condition');

    if (condition === null) {
        return {};
    }

    return this.formatConditionObject(excludedList, condition);
};

Prisme.prototype.formatConditionObject = function(excludedList, condition) {
    this.data = {};

    this.excludedList = excludedList;

    this.setFieldValue('fdc', condition.droppedFrames);
    this.setFieldValue('wsize', condition.videoWidth !== null ? (condition.videoWidth+"x"+condition.videoHeight) : null);
    this.setFieldValue('full', condition.fullScreen);
    this.setFieldValue('fps', condition.fps);
    this.setFieldValue('dspeed', condition.bandwidth / 1000);

    return this.data;
};

Prisme.prototype.formatErrorObject = function(excludedList, error) {
    this.data = {};

    this.excludedList = excludedList;

    var errorCode = error.ocode;
    if (errorCode === null) {
        switch (error.code) {
            case 0:
                // Prisme Stalled error is not an error for Hasplayer, it's a buffering state.
                // This error is added in the function formatterRealTime of the PriseFormatter
                errorCode = this.ORANGE_STALLED_STREAM_ERROR;
                break;
            case "MEDIA_KEYERR":
            case "MEDIA_KEYERR_UNKNOWN":
            case "MEDIA_KEYERR_CLIENT":
            case "MEDIA_KEYERR_SERVICE":
            case "MEDIA_KEYERR_OUTPUT":
            case "MEDIA_KEYERR_HARDWARECHANGE":
            case "MEDIA_KEYERR_DOMAIN":
            case "MEDIA_KEYSYSERR_ACCESS_DENIED":
            case "MEDIA_KEYMESSERR_URL_LICENSER_UNKNOWN":
            case "MEDIA_KEYMESSERR_NOCHALLENGE":
            case "MEDIA_KEYMESSERR_LICENSER_ERROR":
            case "MEDIA_KEYMESSERR_LICENSER_ERROR":
            case "MEDIA_KEYMESSERR_NO_SESSION":
            case "MEDIA_KEYERR_SERVER_CERTIFICATE":
            case "MEDIA_ERR_DECODE":
            case "MEDIA_ERR_ENCRYPTED":
            case "CAPABILITY_ERR_MEDIAKEYS":
            case "MEDIA_ERR_SRC_NOT_SUPPORTED":
            case "MANIFEST_ERR_CODEC":
                errorCode = this.ORANGE_DRM_OR_DECODER_ERROR;
                break;
            case "MEDIA_KEYERR_EXPIRED":
                errorCode = this.ORANGE_DRM_NOMORE_INVALID_LICENSE;
                break;
            case "CC_ERR_PARSE":
            case "MEDIA_ERR_APPEND_SOURCEBUFFER":
            case "MEDIA_ERR_REMOVE_SOURCEBUFFER":
            case "MEDIA_ERR_CREATE_SOURCEBUFFER":
            case "MANIFEST_ERR_PARSE":
            case "MANIFEST_ERR_NOSTREAM":
            case "CAPABILITY_ERR_MEDIASOURCE":
            case "HASPLAYER_INIT_ERROR":
                errorCode = this.ORANGE_UNDEFINED_PLAYER_ERROR;
                break;
            case "DOWNLOAD_ERR_MANIFEST":
            case "DOWNLOAD_ERR_CONTENT":
            case "DOWNLOAD_ERR_INIT":
            case "DOWNLOAD_ERR_SIDX":
            case "MEDIA_ERR_ABORTED":
            case "MEDIA_ERR_NETWORK":
                errorCode = this.ORANGE_HTTP_ERROR;
                break;
            default:
                errorCode = this.ORANGE_UNDEFINED_PLAYER_ERROR;
                break;
        }
    }

    this.setFieldValue('date', error.date);
    this.setFieldValue('url', error.url);
    this.setFieldValue('position', this.formatPositionValue(error.position));
    this.setFieldValue('errorCode', error.code);
    this.setFieldValue('orangeErrorCode', errorCode);
    this.setFieldValue('comment', error.message);

    return this.data;
};

Prisme.prototype.formatLastErrorObject = function(excludedList) {
    var error = this.database.getLastMetricValue('error');

    if (error === null) {
        return {};
    }

    return this.formatErrorObject(excludedList, error);
};

Prisme.prototype.formatMetadataObject = function(excludedList) {
    var session = this.database.getLastMetricValue('session'),
        metadata = this.database.getLastMetricValue('metadata', 'video'),
        contentType,
        condition;

    this.data = {};
    this.excludedList = excludedList;

    this.setFieldValue('playerType', session.playerType);

    if (metadata === null) {
        return this.data;
    }

    if (metadata.hasOwnProperty('duration')) {
        if (metadata.duration < 0) {
            contentType = 'LIVE';
        } else {
            contentType = 'VOD';
        }
    }

    this.setFieldValue('encodingBr', this.formatBitrates(metadata.bitrates));
    this.setFieldValue('contentType', contentType);
    this.setFieldValue('contentEncodingFormat', metadata.codec);
    this.setFieldValue('encapsulation', metadata.format);

    condition = this.database.getLastMetricValue('condition');
    if (condition === null) {
        return this.data;
    }

    this.setFieldValue('fdc', condition.droppedFrames);

    //diffusionMode
    //encodingFr

    return this.data;
};

Prisme.prototype.formatBitrates = function(bitratesArray) {
    var formattedBitratesArray = [],
        i = 0;

    if (Array.isArray(bitratesArray)) {
        for (i = 0; i < bitratesArray.length; i++) {
            if (bitratesArray[i].hasOwnProperty('bitrate') && bitratesArray[i].hasOwnProperty('width') && bitratesArray[i].hasOwnProperty('height')) {
                formattedBitratesArray.push({
                    bitrate: Math.round(bitratesArray[i].bitrate / 1000),
                    width: bitratesArray[i].width,
                    height: bitratesArray[i].height});
            }
        }
    }
    return formattedBitratesArray;
};

Prisme.prototype.formatPositionValue = function(position) {
	return Math.round(position * 1000);
};

