var dashjsEvents = {
    ERROR: 'error',
    MANIFEST_LOADED: 'manifestLoaded',
    METRICS_CHANGED: 'metricsChanged',
    QUALITY_CHANGE_REQUESTED: 'qualityChangeRequested',
    QUALITY_CHANGE_RENDERED: 'qualityChangeRendered',
    TRACK_CHANGE_RENDERED: 'trackChangeRendered',
    SOURCE_INITIALIZED: 'sourceInitialized',
    STREAM_INITIALIZED: 'streamInitialized',
    STREAM_TEARDOWN_COMPLETE: 'streamTeardownComplete',
    PLAYBACK_ENDED: 'playbackEnded',
    PLAYBACK_ERROR: 'playbackError',
    PLAYBACK_NOT_ALLOWED: 'playbackNotAllowed',
    PLAYBACK_METADATA_LOADED: 'playbackMetaDataLoaded',
    PLAYBACK_PAUSED: 'playbackPaused',
    PLAYBACK_PLAYING: 'playbackPlaying',
    PLAYBACK_PROGRESS: 'playbackProgress',
    PLAYBACK_RATE_CHANGED: 'playbackRateChanged',
    PLAYBACK_SEEKED: 'playbackSeeked',
    PLAYBACK_SEEKING: 'playbackSeeking',
    PLAYBACK_SEEK_ASKED: 'playbackSeekAsked',
    PLAYBACK_STARTED: 'playbackStarted',
    PLAYBACK_TIME_UPDATED: 'playbackTimeUpdated',
    PLAYBACK_WAITING: 'playbackWaiting'
};

function DashPlayerCollector(player, video, database) {
    this.player = player;
    this.video = video;
    if (!this.video) {
        throw new Error('Unable to acces video HTML5 element');
    }
    this.database = database;
    this.sessionId = null;
    this.playerId = String(Math.random()).substring(2);

    this.onMetadataLoadedListener = this.onMetadataLoaded.bind(this);
    this.playbackEventListener = this.onPlaybackEvent.bind(this);
    this.timeupdateListener = this.onTimeupdate.bind(this);
    this.errorListener = this.onError.bind(this);
    this.qualityChangeRenderedListener = this.onQualityChangeRendered.bind(this);
    this.teardownListener = this.onTeardown.bind(this);

    this.playbackActions = [];
    this.playbackActions[dashjsEvents.PLAYBACK_PAUSED] = 'pause';
    this.playbackActions[dashjsEvents.PLAYBACK_SEEKING] = 'seek';
    this.playbackActions[dashjsEvents.PLAYBACK_STARTED] = 'play';

    this.playbackStates = [];
    this.playbackStates[dashjsEvents.PLAYBACK_ENDED] = 'stopped';
    this.playbackStates[dashjsEvents.PLAYBACK_PAUSED] = 'paused';
    this.playbackStates[dashjsEvents.PLAYBACK_PLAYING] = 'playing';
    this.playbackStates[dashjsEvents.PLAYBACK_SEEKING] = 'seeking';    
    this.playbackStates[dashjsEvents.PLAYBACK_WAITING] = 'buffering';    
}

DashPlayerCollector.prototype.init = function(sessionId, stream) {
    this.sessionId = sessionId;

    // Add new session metric
    this.addSession(stream);
    this.addState('startup');
};

DashPlayerCollector.prototype.stop = function() {
};

DashPlayerCollector.prototype.listen = function() {

    this.dashMetrics = this.player.getDashMetrics();

    this.player.on(dashjsEvents.PLAYBACK_METADATA_LOADED, this.onMetadataLoadedListener);
    this.player.on(dashjsEvents.PLAYBACK_ENDED, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_PAUSED, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_PLAYING, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_SEEKING, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_STARTED, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_WAITING, this.playbackEventListener);
    this.player.on(dashjsEvents.PLAYBACK_TIME_UPDATED, this.timeupdateListener);

    this.player.on(dashjsEvents.ERROR, this.errorListener);
    this.player.on(dashjsEvents.QUALITY_CHANGE_RENDERED, this.qualityChangeRenderedListener);
    this.player.on(dashjsEvents.STREAM_TEARDOWN_COMPLETE, this.teardownListener);

};

DashPlayerCollector.prototype.reset = function() {

    this.player.off(dashjsEvents.PLAYBACK_METADATA_LOADED, this.onMetadataLoadedListener);
    this.player.off(dashjsEvents.PLAYBACK_ENDED, this.playbackEventListener);
    this.player.off(dashjsEvents.PLAYBACK_PAUSED, this.playbackEventListener);
    this.player.off(dashjsEvents.PLAYBACK_PLAYING, this.playbackEventListener);
    this.player.off(dashjsEvents.PLAYBACK_SEEKING, this.playbackEventListener);
    this.player.off(dashjsEvents.PLAYBACK_STARTED, this.playbackEventListener);
    this.player.off(dashjsEvents.PLAYBACK_TIME_UPDATED, this.timeupdateListener);
    this.player.off(dashjsEvents.STREAM_TEARDOWN_COMPLETE, this.teardownListener);
    this.player.off(dashjsEvents.PLAYBACK_WAITING, this.playbackEventListener);

    this.player.off(dashjsEvents.ERROR, this.errorListener);
    this.player.off(dashjsEvents.QUALITY_CHANGE_RENDERED, this.qualityChangeRenderedListener);
    this.player.off(dashjsEvents.STREAM_TEARDOWN_COMPLETE, this.teardownListener);
};

DashPlayerCollector.prototype.addSession = function(stream) {
    var metric = new MetricsVo.Session();
    metric.id = this.sessionId;
    metric.playerid = this.playerId;
    metric.browserid = this.database.getBrowserId();
    metric.userAgent = navigator.userAgent;
    metric.uri = stream.url;
    metric.provider = document.location.href; //document.referrer;
    metric.loopMode = this.video.loop;
    metric.startTime = new Date().getTime();
    metric.endTime = null;
    metric.playerType = 'dash.js_' + this.player.getVersion();

    this.database.addMetric({session: metric});
};

DashPlayerCollector.prototype.addMetadata = function(type) {
    // Get video bitrates
    var bitrates = this.player.getBitrateInfoListFor(type);

    // Get video media info
    var mediaInfo = this.player.getCurrentTrackFor(type);

    var metric = new MetricsVo.MetaData();
    metric.contentType = type;
    metric.codec = mediaInfo.codec;
    metric.format = mediaInfo.mimeType;
    metric.bitrates = bitrates;
    metric.duration = this.player.duration();

    this.database.addMetric({metadata: metric});
};

DashPlayerCollector.prototype.addEncoding = function(type, previousQuality, newQuality) {
    var bitrates = this.player.getBitrateInfoListFor(type);
    if (!bitrates) {
        return;
    }

    var metric = new MetricsVo.Encoding();
    metric.contentType = type;
    metric.bitrate = bitrates[newQuality].bitrate;
    metric.position = this.video.currentTime;
    metric.previousBitrate = isNaN(previousQuality) ? 0 : bitrates[previousQuality].bitrate;

    this.database.addMetric({encoding: metric});
};

DashPlayerCollector.prototype.addState = function(state, reason) {
    // Ignore 'buffering' state in 'startup' state
    var currentState = this.database.getLastMetricValue('state');
    if (state === 'buffering' && (currentState.current == 'startup' || currentState.current == 'seeking')) {
        return;
    }

    var metric = new MetricsVo.State();
    metric.current = state;
    metric.position = this.video.currentTime;
    if (reason) {
        metric.reason = reason;
    }

    this.database.addMetric({state: metric});
};

DashPlayerCollector.prototype.addAction = function(action) {
    var session = this.database.getLastMetricValue('session');
    if (!session) {
        return;
    }

    var metric = new MetricsVo.Action();
    metric.type = action;
    metric.origin = session.currentPosition ? session.currentPosition : 0;
    metric.position = this.video.currentTime;

    this.database.addMetric({action: metric});
};

DashPlayerCollector.prototype.addCondition = function() {

    var hasWebKit = ("webkitDroppedFrameCount" in this.video),
        hasQuality = ("getVideoPlaybackQuality" in this.video),
        playbackQuality,
        metric = new MetricsVo.Condition();

    if (hasQuality) {
        playbackQuality = this.video.getVideoPlaybackQuality();
    }
    else if (hasWebKit) {
        playbackQuality = {
            droppedVideoFrames: this.video.webkitDroppedFrameCount,
            totalVideoFrames: this.video.webkitDecodedFrameCount
        };
    }

    metric.droppedFrames = playbackQuality.droppedFrames;
    metric.totalVideoFrames = playbackQuality.totalVideoFrames;
    metric.videoWidth = this.video.videoWidth;
    metric.videoHeight = this.video.videoHeight;
    metric.fullscreen = ((document.webkitIsFullScreen || document.msFullscreenElement || document.mozFullScreen) ? 1 : 0);
    metric.bandwidth = this.player.getAverageThroughput('video');

    this.database.addMetric({condition: metric});
};

DashPlayerCollector.prototype.onMetadataLoaded = function() {
    try {
        this.addMetadata('video');
    } catch (ex) {
        throw (ex);
    }
};

DashPlayerCollector.prototype.onPlaybackEvent = function(e) {
    try {
        var state = this.playbackStates[e.type],
            reason = (e.type === dashjsEvents.PLAYBACK_ENDED) ? 1 : undefined;
        if (state) {
            this.addState(state, reason);
        }
    
        var action = this.playbackActions[e.type];
        if (action) {
            this.addAction(action);
        }
    } catch (ex) {
        throw (ex);
    }
};

DashPlayerCollector.prototype.onTimeupdate = function() {
    try {
        var session = this.database.getLastMetricValue('session');
        if (session === null) {
            return;
        }

        // Update session current position
        session.currentPosition = this.video.currentTime;
        if (session.maxPosition === undefined || this.video.currentTime > session.maxPosition) {
            session.maxPosition = this.video.currentTime;
        }

        // Update session current state duration
        this.database.updateCurrentState();

        // Add condition metric
        this.addCondition();

    } catch(ex) {
        throw (ex);
    }
};

DashPlayerCollector.prototype.onQualityChangeRendered = function(event) {
    try {
        if (event.mediaType !== 'video' && event.mediaType !== 'audio') {
            return;
        }    
        this.addEncoding(event.mediaType, event.oldQuality, event.newQuality);
    } catch (ex) {
        throw (ex);
    }
};

DashPlayerCollector.prototype.onError = function(e) {
    try {
        var metric = new MetricsVo.Error();
        metric.message = e.error;
        metric.position = this.video.currentTime;
        this.database.addMetric({error: metric});
    } catch (ex) {
        throw (ex);
    }
};

DashPlayerCollector.prototype.onTeardown = function() {
    try {
        var reason = this.database.getLastMetricValue('error') ? 2 : 0;
        this.addState('stopped', reason);
    } catch(ex) {
        throw (ex);
    }
};

// needed to be referenced in MetricsAgent scope
MetricsAgent.collectors.DashPlayerCollector = DashPlayerCollector;


