function HasPlayerCollector(player, video, database) {
    this.player = player;
    this.video = video;
    if (!this.video) {
        throw new Error('Unable to acces video HTML5 element');
    }
    this.database = database;
    this.sessionId = null;
    this.playerId = String(Math.random()).substring(2);

    this.metricAddedListener = this.onMetricAdded.bind(this);
    this.metricUpdatedListener = this.onMetricUpdated.bind(this);
    this.errorListener = this.onError.bind(this);
    this.timeupdateListener = this.onTimeupdate.bind(this);
    this.playbitrateListener = this.onPlaybitrate.bind(this);
    this.fullscreenchangeListener = this.onFullscreenchange.bind(this);
    this.closeListener = this.onClose.bind(this);
}

HasPlayerCollector.prototype.init = function(sessionId) {
    this.sessionId = sessionId;
    this.previousVideoBandwith = 0;
    this.previousAudioBandwith = 0;
};

HasPlayerCollector.prototype.stop = function() {
};

HasPlayerCollector.prototype.listen = function() {

    this.customMetricsExtension = this.player.getMetricsExt();

    this.player.addEventListener("metricAdded", this.metricAddedListener);
    this.player.addEventListener("metricUpdated", this.metricUpdatedListener);
    this.player.addEventListener("error", this.errorListener);

    this.video.addEventListener("play_bitrate", this.playbitrateListener);
    this.video.addEventListener("timeupdate", this.timeupdateListener);

    this.video.addEventListener("webkitfullscreenchange", this.fullscreenchangeListener);
    this.video.addEventListener("fullscreenchange", this.fullscreenchangeListener);
    this.video.parentElement.addEventListener("fullscreenchange", this.fullscreenchangeListener);
    this.video.parentElement.addEventListener("webkitfullscreenchange", this.fullscreenchangeListener);

    window.addEventListener("beforeunload", this.closeListener, false);
};

HasPlayerCollector.prototype.reset = function() {

    this.player.removeEventListener("metricAdded", this.metricAddedListener);
    this.player.removeEventListener("metricUpdated", this.metricUpdatedListener);
    this.player.removeEventListener("error", this.errorListener);

    this.video.removeEventListener("play_bitrate", this.playbitrateListener);
    this.video.removeEventListener("timeupdate", this.timeupdateListener);

    this.video.removeEventListener("webkitfullscreenchange", this.fullscreenchangeListener);
    this.video.removeEventListener("fullscreenchange", this.fullscreenchangeListener);
    this.video.parentElement.removeEventListener("fullscreenchange", this.fullscreenchangeListener);
    this.video.parentElement.removeEventListener("webkitfullscreenchange", this.fullscreenchangeListener);

    window.removeEventListener("beforeunload", this.closeListener);
};

HasPlayerCollector.prototype.onMetricAdded = function(metric) {
    try {
        if (this.sessionId === null || !metric || !metric.data) {
            return;
        }

        var objStorage = {};

        switch (metric.data.metric) {
            case "PlayList":
                objStorage.action = this.mapActionObject(metric.data);
                this.database.addMetric(objStorage);
                break;
            case "State":
                if (metric.data.stream === "video") {
                    objStorage.state = this.mapStateObject(metric.data);
                    this.database.addMetric(objStorage);
                }
                break;
            case "Session":
                objStorage.session = this.mapSessionObject(metric.data);
                this.database.addMetric(objStorage);
                this.addState("stopped");
                break;
            case "ManifestReady":
                this.addState("startup");
                this.sendMetaData("video");
                break;
            case "PlaybackQuality":
                objStorage.condition = this.mapPlaybackQualityObject(metric.data);
                this.database.addMetric(objStorage);
                break;
            case "VideoResolution":
                objStorage.condition = this.mapVideoResolutionObject(metric.data);
                this.database.addMetric(objStorage);
                break;
            default:
                //console.log("metricAdded event from "+metric.data.metric+" metric not implemented");
        }
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onMetricAdded due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onMetricUpdated = function(metric) {
    try {
        if (this.sessionId === null || !metric || !metric.data) {
            return;
        }

        var objStorage = {};

        switch (metric.data.metric) {
            case "HttpRequestTrace":
                objStorage.condition = this.mapHttpRequestTraceObject(metric.data);
                if (objStorage.condition !== null) {
                    this.database.addMetric(objStorage);
                }
                break;
            default:
        }
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onMetricUpdated due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onError = function(event) {
    try {
        if (!event || !event.data) {
            return;
        }

        var error = event.data,
            objError = {};

        objError.error = new MetricsVo.Error();

        objError.error.code = error.code;

        if (error.message) {
            objError.error.message = error.message;
        }

        switch (error.code) {
            case "DOWNLOAD_ERR_MANIFEST":
            case "DOWNLOAD_ERR_SIDX":
            case "DOWNLOAD_ERR_CONTENT":
            case "DOWNLOAD_ERR_INIT":
                objError.error.url = error.data.url;
                if (error.data.status) {
                    objError.error.message += " - status = " + error.data.status;
                }
                if (error.data.request) {
                    objError.error.message += " - status = " + error.data.request.status;
                }
                break;
        }

        if (error.data && error.data.currentTime) {
            objError.error.position = error.data.currentTime;
        }

        this.database.addMetric(objError);
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onError due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onPlaybitrate = function(event) {
    try {
        if (!event || !event.detail) {
            return;
        }
        var metric = {
                data: {
                    value: {}
                }
            },
            objStorage = {};

        metric.data.stream = event.detail.type;
        metric.data.bandwith = this.customMetricsExtension.getBandwidthForRepresentation(event.detail.representationId);
        metric.data.max = this.customMetricsExtension.getMaxIndexForBufferType("video");
        metric.data.value.to = event.detail.representationId;
        metric.data.value.mt = event.detail.time;

        objStorage.encoding = this.mapEncodingObject(metric.data);

        this.database.addMetric(objStorage);
        if (metric.data.stream === "video") {
            this.previousVideoBandwith = metric.data.bandwith;
        } else if (metric.data.stream === "audio") {
            this.previousAudioBandwith = metric.data.bandwith;
        }
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onPlaybitrate due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onTimeupdate = function() {
    try {
        var session = this.database.getLastMetric('session');

        //if no session has been created, or if startBufferingTime has not been set, do nothing
        //timeUpdate event may be sent during changing video stream
        if (session === null/* || session.startBufferingTime === null*/) {
            return;
        }
        session.currentPosition = this.video.currentTime;

        if (session.maxPosition === undefined || this.video.currentTime > session.maxPosition) {
            session.maxPosition = this.video.currentTime;
        }
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onTimeupdate due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onFullscreenchange = function() {
    try {
        var objCondition = {},
            conditionVo = new MetricsVo.Condition();

        conditionVo.fullScreen = this.isVideoFullScreen();
        objCondition.condition = conditionVo;

        this.database.addMetric(objCondition);
    } catch(ex) {
        throw ('an error occurs in metricsAgent, HasPlayerCollector::onFullscreenchange due to '+ex.message);
    }
};

HasPlayerCollector.prototype.onClose = function() {
    if (this.sessionId === null) {
        return;
    }

    //get last metric state
    var state = this.database.getLastMetric('state');

    if (!state || state.current === 'stopped') {
        return;
    }

    //on window close event, add a stop state with reason = 0
    this.addState("stopped", 0);
};

HasPlayerCollector.prototype.isVideoFullScreen = function() {
    return ((document.webkitIsFullScreen || document.msFullscreenElement || document.mozFullScreen) ? 1 : 0);
};


HasPlayerCollector.prototype.addState = function(state, reason) {
    var metric = {
            data: {
                value: {
                    current: state,
                    position: this.video.currentTime,
                    reason: reason
                }
            }
        },
        objStorage = {};
    objStorage.state = this.mapStateObject(metric.data);
    this.database.addMetric(objStorage);
};

HasPlayerCollector.prototype.sendMetaData = function(type) {
    var objStorage = {},
        manifest,
        metric,
        bitrates,
        format;

    manifest = this.customMetricsExtension.manifestModel.getValue();
    if (!manifest) {
        // manifest not defined.
        // this may corresponds to native HLS stream (Safari)
        metric = {
            data: {
                contentType: type,
                codec: '',
                duration: this.video.duration
            }
        };
        metric.data.format = 'video/mp2t';
        metric.data.bitrates = [];
        objStorage.metadata = this.mapMetaDataObject(metric.data);
        this.database.addMetric(objStorage);
        return;
    }

    metric = {
        data: {
            contentType: type,
            codec: this.customMetricsExtension.getCodecForType(type),
            duration: this.customMetricsExtension.getDuration()
        }
    };

    bitrates = this.customMetricsExtension.getBitratesWithResolutionForType(type);
    if (bitrates.length > 0) {
        metric.data.bitrates = bitrates;
    }

    format = this.customMetricsExtension.getFormatForType(type);
    //if format not defined, the current type is not defined in the manifest.
    //don't send metadata metric for this type
    if (format) {
        metric.data.format = format;
        objStorage.metadata = this.mapMetaDataObject(metric.data);
        this.database.addMetric(objStorage);
    }
};

HasPlayerCollector.prototype.mapSessionObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var sessionVo = new MetricsVo.Session();

    sessionVo.id = this.sessionId;
    sessionVo.playerid = this.playerId;
    sessionVo.browserid = this.database.getBrowserId();
    sessionVo.userAgent = navigator.userAgent;
    sessionVo.uri = metric.value.uri;
    sessionVo.provider = document.location.href; //document.referrer;
    sessionVo.loopMode = metric.value.loopMode;
    sessionVo.startTime = new Date().getTime();
    sessionVo.endTime = metric.value.endTime;
    sessionVo.playerType = metric.value.playerType;

    return sessionVo;
};

HasPlayerCollector.prototype.mapMetaDataObject = function(metric) {
    if (!metric) {
        return;
    }

    var metaDataVo = new MetricsVo.MetaData();

    metaDataVo.bitrates = metric.bitrates;
    metaDataVo.contentType = metric.contentType;
    metaDataVo.duration = metric.duration;
    metaDataVo.format = metric.format;
    metaDataVo.codec = metric.codec;

    return metaDataVo;
};

HasPlayerCollector.prototype.mapStateObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var stateVo = new MetricsVo.State();

    stateVo.current = metric.value.current;
    stateVo.position = metric.value.position;
    stateVo.reason = metric.value.reason;

    return stateVo;
};

HasPlayerCollector.prototype.mapHttpRequestTraceObject = function(metric) {
    if (!metric) {
        return;
    }

    var conditionVo = null,
        httpRequest,
        lastTrace;

    if (metric.stream && metric.stream === "video") {
        httpRequest = metric.value;

        if (httpRequest.type === "Media Segment" && httpRequest.tfinish) {
            lastTrace = httpRequest.trace[httpRequest.trace.length - 1] || null;
            conditionVo = new MetricsVo.Condition();
            conditionVo.bandwidth = lastTrace.b[0] * 8000 / (httpRequest.tfinish.getTime() - httpRequest.trequest.getTime());
        }
    }

    return conditionVo;
};

HasPlayerCollector.prototype.mapPlaybackQualityObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var conditionVo = new MetricsVo.Condition();

    conditionVo.mt = metric.value.mt;
    conditionVo.droppedFrames = metric.value.droppedFrames;
    conditionVo.totalVideoFrames = metric.value.totalVideoFrames;

    return conditionVo;
};

HasPlayerCollector.prototype.mapVideoResolutionObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var conditionVo = new MetricsVo.Condition();

    conditionVo.videoWidth = metric.value.width;
    conditionVo.videoHeight = metric.value.height;
    conditionVo.fullScreen = this.isVideoFullScreen();

    return conditionVo;
};

HasPlayerCollector.prototype.mapErrorObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var errorVo = new MetricsVo.Error();

    errorVo.code = metric.value.code;
    errorVo.message = metric.value.message;

    return errorVo;
};

HasPlayerCollector.prototype.mapActionObject = function(metric) {
    var session = this.database.getLastMetric('session');

    if (!metric || !metric.value || !session) {
        return;
    }

    var actionVo = new MetricsVo.Action();

    actionVo.type = metric.value.starttype;
    actionVo.origin = session.currentPosition ? session.currentPosition : 0;
    actionVo.position = metric.value.mstart;
    actionVo.speed = metric.value.speed;

    return actionVo;
};

HasPlayerCollector.prototype.mapEncodingObject = function(metric) {
    if (!metric || !metric.value) {
        return;
    }

    var encodingVo = new MetricsVo.Encoding();

    encodingVo.contentType = metric.stream;
    encodingVo.bitrate = metric.bandwith;
    encodingVo.position = metric.value.mt;

    if (metric.stream === "video") {
        encodingVo.previousBitrate = this.previousVideoBandwith;
    } else if (metric.stream === "audio") {
        encodingVo.previousBitrate = this.previousAudioBandwith;
    }

    return encodingVo;
};

// needed to be referenced in MetricsAgent scope
MetricsAgent.collectors.HasPlayerCollector = HasPlayerCollector;
